INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(1, 'Green Tea Balancing Skin EX', '239.00', 0, 'he Green Tea Balancing Skin EX by Innisfree is a refreshing toner that is specially formulated to restore and balance the skin\'s natural moisture levels. Infused with the goodness of green tea, it provides a burst of hydration, while helping to control excess oil and sebum production. This lightweight toner is easily absorbed into the skin, leaving it feeling refreshed, revitalized, and prepped for the next steps in your skincare routine. With its gentle yet effective formula, it helps to clarify and refine the skin\'s texture, promoting a smoother and more even complexion. ', 4.3, 12, , 150);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(2, 'Green Tea Seed Serum', '150.00', 0, 'Innisfree Green Tea Seed Cream is a nourishing moisturizer enriched with green tea seeds. It provides intense hydration, strengthens the skin\'s moisture barrier, and leaves the skin feeling soft, smooth, and refreshed. With its lightweight texture and antioxidant-rich formula, this cream helps protect the skin from environmental stressors and promotes a healthier, glowing complexion. Experience the revitalizing benefits of green tea with Innisfree Green Tea Seed Cream.', 3.3, 8, , 150);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(3, 'Innisfree Green Tea Seed Cream ', '129.00', 0, 'The Innisfree Green Tea Seed Cream is a daily moisturizing cream enriched with Green Tea Tri-biotics. It is specifically designed to address dehydrated skin and replenish lost hydration, providing intense moisturization, soothing benefits, and nourishment for a healthy-looking complexion. With its unique formulation, this cream helps strengthen the skin\'s moisture barrier, preventing further dehydration and promoting a revitalized appearance.', 5, 8, , 30);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(4, 'Green Tea Special Kit EX', '389.00', 1, 'The Green Tea Special Kit EX by Innisfree offers a comprehensive skincare experience infused with the nourishing power of green tea. This special kit contains a curated selection of products designed to cleanse, hydrate, and revitalize your skin.\r\nStart your skincare routine with the Green Tea Balancing Cleansing Foam, a gentle cleanser that effectively removes impurities and excess oil, leaving your skin feeling refreshed and balanced. Follow it up with the Green Tea Seed Serum, a lightweight yet deeply hydrating serum that delivers a boost of moisture to your skin, leaving it plump and radiant.', 4.1, 4, , 450);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(5, 'Balancing Skin Care Set', '444.00', 1, 'The Balancing Skin Care Set is a comprehensive collection of skincare products that work together to restore balance and nourishment to your skin. This set includes a gentle facial cleanser, a refreshing toner, a potent facial serum, and a lightweight moisturizer. Each product is carefully formulated to hydrate, revitalize, and improve the overall health of your skin. With the Balancing Skin Care Set, you can achieve a harmonious and radiant complexion while indulging in a pampering skincare experience.', 5.1, 13, , 650);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(6, 'Green Tea Cleansing Oil', '129.00', 0, 'The Green Tea Cleansing Oil is a skincare essential that effectively removes impurities, dirt, and makeup while nourishing the skin. Infused with the goodness of green tea extract, it works gently to dissolve even the most stubborn makeup and debris, leaving the skin feeling clean and refreshed. This lightweight oil formula effortlessly glides on the skin, melting away impurities without stripping away the skin\'s natural moisture. It helps to unclog pores, balance oil production, and promote a healthier complexion. Enriched with antioxidants, the Green Tea Cleansing Oil also provides protection against environmental aggressors, helping to keep the skin looking youthful and radiant. Pamper your skin with the soothing and purifying benefits of green tea with this invigorating cleansing oil.', 3.3, 2, , 210);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(7, 'Freesh Green Tea Set +Super Volcano', '555.00', 1, 'Experience the ultimate cleansing and detoxifying power with the Freesh Green Tea Set + Super Volcano. This set combines the purifying benefits of green tea and the deep-cleansing properties of volcanic ash to leave your skin feeling refreshed and renewed. The Green Tea Cleansing Foam gently removes impurities, while the Super Volcano Clay Mousse Mask deeply purifies and unclogs pores. Achieve a clearer and healthier complexion with this simple yet effective skincare set.', 3.6, 0, , 335);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(8, 'Fresh Moisturize Lip Blam', '89.00', 0, 'Indulge your lips with the nourishing hydration of the Fresh Moisturize Lip Balm. Formulated with moisturizing ingredients, this lip balm helps to keep your lips soft, smooth, and moisturized throughout the day. It glides on effortlessly, providing a protective barrier against dryness and external aggressors. Say goodbye to dry, chapped lips and hello to irresistibly moisturized lips with this refreshing lip balm.', 4.2, 2, , 3);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(9, 'Green Tea Cleansing Water', '112.00', 0, ' Green Tea Cleansing Water. This multi-purpose cleanser effectively removes impurities, makeup, and dirt from your skin, leaving it clean, refreshed, and hydrated. Infused with the goodness of green tea extract, it helps to soothe and purify the skin, while maintaining its natural moisture balance. The lightweight formula glides effortlessly, leaving no residue behind. Enjoy the rejuvenating sensation and the radiant glow that comes with using Green Tea Cleansing Water for your daily skincare routine.', 3.5, 16, , 210);
INSERT INTO `products` (`id`, `nama`, `price`, `isbundled`, `description`, `rating`, `stock`, `product_img`, `size`) VALUES
(10, 'Super THREE Balancing Set', '443.00', 1, 'Achieve balance and rejuvenation with the Super THREE Balancing Set. This set features three essential skincare products designed to nourish and restore your skin\'s natural harmony. Start with the Balancing Cleansing Foam to effectively remove impurities and excess oil. Follow up with the Balancing Skin EX, a refreshing toner that refines pores and boosts moisture. Finally, complete your routine with the Balancing Lotion EX, a lightweight moisturizer that hydrates and leaves your skin feeling smooth and radiant. Experience the power of these three products working together to bring out the best in your skin, leaving it balanced and revitalized.', 4.7, 18, , 340);

